import { useState } from "react";
import { styled } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";
import Grid from "@mui/material/Grid";
import { Container } from "@mui/material";
import Typography from "@mui/material/Typography";
import CircularProgress from '@mui/material/CircularProgress';

//component
import SymbolsFetch from "./Components/SymbolsData";
import SetCurrencyData from "./Components/SetCurrencyData";
import ConvertRates from "./Components/ConvertRates";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: "#2a2826",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: "#fff",
  ...theme.applyStyles("kight", {
    backgroundColor: "#1A2027",
    height: "200px",
  }),
}));

export default function BasicGrid() {
  const [isLoadingRates, setIsLoadingRates] = useState(true);
  const [baseSymbol, setBaseSymbol] = useState('');
  const [latestRate, setLatestRate] = useState({});
  console.log(latestRate);
  const [date, setDate] = useState("");
  const [symbols, setSymbols] = useState({});
  const [fromCurrency, setFromCurrency] = useState("USD");
  const [toCurrency, setToCurrency] = useState("PHP");
  const [amount, setAmount] = useState("");
  const [converted, setConverted] = useState(null);

  const getRateFor = (currency) => {
  return latestRate[currency] ? latestRate[currency] : null;
};

  return (
    <Container>
      <Box sx={{ flexGrow: 1, color: "white" }}>
        <Grid
          container
          spacing={2}
          rowSpacing={1}
          columnSpacing={{ xs: 1, sm: 2, md: 3, lg: 2 }}
        >
          <Grid item xs={12} size={12}>
            <Item sx={{ p: 2 }}>
              {converted ? (
                <p>
                  {amount} {fromCurrency} = {converted.toFixed(2)} {toCurrency}
                </p>
              ) : (
                <p>Please enter an amount and select currencies to convert.</p>
              )}
            </Item>
          </Grid>
          <Grid item xs={12} md={4} size={4}>
            <SymbolsFetch
              Item={Item}
              symbols={symbols}
              setSymbols={setSymbols}
              fromCurrency={fromCurrency}
              setFromCurrency={setFromCurrency}
            ></SymbolsFetch>
          </Grid>
          <Grid item xs={12} md={4} size={4}>
            <ConvertRates
              toCurrency={toCurrency}
              setToCurrency={setToCurrency}
              Item={Item}
              symbols={symbols}
              setSymbols={setSymbols}
              fromCurrency={fromCurrency}
              setFromCurrency={setFromCurrency}
              amount={amount}
              setAmount={setAmount}
              setConverted={setConverted}
              setDate={setDate}
              setBaseSymbol={setBaseSymbol}
              setLatestRate={setLatestRate}
              setIsLoadingRates={setIsLoadingRates}
            ></ConvertRates>
          </Grid>
          <Grid item xs={12} md={4} size={4}>
            <SetCurrencyData
              item
              xs={12}
              sm={6}
              md={4}
              toCurrency={toCurrency}
              setToCurrency={setToCurrency}
              Item={Item}
              symbols={symbols}
              setSymbols={setSymbols}
              fromCurrency={fromCurrency}
              setFromCurrency={setFromCurrency}
            ></SetCurrencyData>
          </Grid>
          <Grid item xs={12}>
            <Item sx={{ p: 2 }}>
              <Grid container spacing={2}>
                <Grid item xs={6}>
                  <Box sx={{ p: 2, bgcolor: "#3f3f3fff" }}><p>
      {fromCurrency} - Rate:{" "}
      {getRateFor(fromCurrency) !== null ? (
        getRateFor(fromCurrency)
      ) : (
        <CircularProgress size={16} />
      )}
    </p>
    <p>
      {toCurrency} - Rate:{" "}
      {getRateFor(toCurrency) !== null ? (
        getRateFor(toCurrency)
      ) : (
        <CircularProgress size={16} />
      )}
    </p>
</Box>
                </Grid>
                <Grid item xs={6}>
                  <Box sx={{ p: 2, bgcolor: "#3f3f3fff" }}></Box>
                </Grid>
                <Grid item xs={6}>
                  <Box sx={{ p: 2, bgcolor: "#3f3f3fff" }}>Item 3</Box>
                </Grid>
                <Grid item xs={6}>
                  <Box sx={{ p: 2, bgcolor: "#3f3f3fff" }}>Item 4</Box>
                </Grid>
              </Grid>
            </Item>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}
